import paginationFactory from "react-bootstrap-table2-paginator";
import cellEditFactory from "react-bootstrap-table2-editor";









class Zone extends React.Component {
  constructor(props) {
        super(props);

        this.state = {
            activeItem: {
                id: "",
                zone_id: "",
                name: "",
                SLT: "",
                description: "",
                threats: ""
            },

            fooInstance: Foo
        };
    }


importZone = () => (

    <ZoneList />
);


Zone = () => (
    <div/>
);


Tables = () => (

    <Container fluid className="p-0">
            {this.Zone()}

    </Container>

);

render() {
    return (
        <div>
            {this.Tables()}
        </div>
    )
  }
}

export default Zone;
